function initTable(){var n=localStorage.getItem("token");$table.bootstrapTable({height:getHeight(),ajaxOptions:{headers:{Authorization:"bearer "+n}},columns:[{title:"Proceso",field:"tarea.solicitud.proceso.nombre",align:"center",valign:"middle"},{title:"Ticket",field:"tarea.solicitud.numeroTicket",align:"center",valign:"middle",formatter:function(n){return'<a href="#" class="btn-link">'+n+"<\/a>"}},{title:"Tarea",field:"tarea.etapa.nombre",align:"center",valign:"middle"},{title:"Paciente",field:"cotizacion.cliente.nombres",align:"center",valign:"middle",formatter:function(n,t){return t.cotizacion.cliente.rut+", "+t.cotizacion.cliente.nombres}},{title:"Iniciado el",field:"tarea.fechaInicio",align:"center",valign:"middle",formatter:function(n,t){return console.log(t),new Date(n).toLocaleString()}}]});setTimeout(function(){$table.bootstrapTable("resetView")},200);$table.on("expand-row.bs.table",function(n,t,i,r){t%2==1&&(r.html("Loading from ajax request..."),$.get("LICENSE",function(n){r.html(n.replace(/\n/g,"<br>"))}))});$table.on("all.bs.table",function(n,t,i){console.log(t,i)});$(window).resize(function(){$table.bootstrapTable("resetView",{height:getHeight()})})}function responseHandler(n){return $.each(n.rows,function(n,t){t.state=$.inArray(t.id,selections)!==-1}),n}function detailFormatter(n,t){var i=[];return $.each(t,function(n,t){i.push("<p><b>"+n+":<\/b> "+t+"<\/p>")}),i.join("")}function getHeight(){return $(window).height()-$("h1").outerHeight(!0)}var $table=$("#table");$(function(){initTable()});